import image1 from '../images/img1.svg';
import image2 from '../images/img2.svg';
import image3 from '../images/img3.svg';
import image4 from '../images/img4.svg';
import image5 from '../images/img5';
import image6 from '../images/img6';
import image7 from '../images/img7';
import image8 from '../images/img8';
import image9 from '../images/img9';
import image10 from '../images/img10';


const imgArray = [
  {img: image1},
  {img: image2},
  {img: image3},
  {img: image4},
  {img: image5},
  {img: image6},
  {img: image7},
  {img: image8},
  {img: image9},
  {img: image10}
]


export default imgArray;
